import axios from 'axios';

const insteance = axios.create({
    baseURL: "https://jsonplaceholder.typicode.com",
    timeput: 5000,
})

insteance.interceptors.response.use(
    (res) => {
        console.log("성공", res)
        return res
    },
    (err) => {
        console.log("실패", err)
        return err
    }
)

export default insteance
